function ProductCategorySolutionViewModel(){var n=this;n.listProduct=ko.observableArray([]);n.listProductCategory=ko.observableArray([]);n.renderResult=function(){n.listProductCategory([]);var t=_.groupBy(n.listProduct(),function(n){return n.productCategoryId});t&&_.each(t,function(t){var i=t[0],r={productCategoryId:i.productCategoryId,productCategoryImage:i.productCategoryImage,productCategoryName:i.productCategoryName,products:t};n.listProductCategory.push(r)})};n.initProductSlider=function(n){$(`#product-slider-${n}`).lightSlider({item:3,auto:!1,loop:!1,slideMove:1,speed:1500,pause:3e3,slideEndAnimation:!1,slideMargin:10,pauseOnHover:!1,controls:!0,prevHtml:'<img src="/images/facion/pev.png" />',nextHtml:'<img src="/images/facion/nex.png" />',pager:!1,responsive:[{breakpoint:800,settings:{item:2,slideMove:1}},{breakpoint:480,settings:{item:1,slideMove:1}}]})};$(document).ready(function(){n.listProduct(products);n.renderResult();_.each(n.listProductCategory(),function(t){setTimeout(()=>{n.initProductSlider(t.productCategoryId)},100)})})}var viewModel=new ProductCategorySolutionViewModel;ko.applyBindings(viewModel,document.getElementsByClassName("solution")[0]);